      <Link to="/news/article" className={style["articles__link"]}>
        <ArrowRight size={20} color="#CF5555" />
        Собираем документы для упрощенного бакнротства
      </Link>
      <Link to="/news/article" className={style["articles__link"]}>
        <ArrowRight size={20} color="#CF5555" />
      </Link>
      <Link to="/news/article" className={style["articles__link"]}>
        <ArrowRight size={20} color="#CF5555" />
      </Link>
    </section>
  );
};

export default OtherArticles;
